webpackJsonp([1676073966197],{412:function(n,a){n.exports={data:{allPostTitles:{edges:[{node:{frontmatter:{title:"Configuration",doc:2,section:1,type:"doc"},fields:{slug:"/configuration"}}},{node:{frontmatter:{title:"Getting Started",doc:1,section:1,type:"doc"},fields:{slug:"/getting-started"}}},{node:{frontmatter:{title:"Docs",doc:4,section:1,type:"doc"},fields:{slug:"/docs"}}},{node:{frontmatter:{title:"React",doc:3,section:1,type:"doc"},fields:{slug:"/react"}}}]},postBySlug:{html:'<p>Dazzling is backed by <a href="https://github.com/gatsbyjs/gatsby">Gatsby</a>, an amazing framework that lets you generates static content (websites, but really - anything) while keeping the development experience tied to React, GraphQL, and many more first-class frontend tools.</p>\n<p>Gatsby lets you have your cake and eat it too; and Dazzling puts the whole thing on steriods.</p>\n<p>After <a href="getting-started">generating</a> your first Dazzling website, you\'ll see this layout (which is standard Gatsby layout):</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">src\n├── assets\n├── css\n│   └── index.scss\n├── html.jsx\n├── layouts\n│   └── index.jsx\n├── pages\n│   └── index.jsx\n└── templates\n    └── doc.jsx</code></pre>\n      </div>\n<p>And if we take a look at <code class="language-text">pages/index.jsx</code>, we see this:</p>\n<div class="gatsby-highlight">\n      <pre class="language-jsx"><code class="language-jsx"><span class="token comment">// various imports</span>\n<span class="token keyword">export</span> <span class="token keyword">default</span> <span class="token keyword">class</span> <span class="token class-name">Index</span> <span class="token keyword">extends</span> <span class="token class-name">Component</span> <span class="token punctuation">{</span>\n  <span class="token function">render</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">return</span> <span class="token punctuation">(</span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>LandingPage</span> <span class="token attr-name">config</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span>config<span class="token punctuation">}</span></span> <span class="token spread"><span class="token punctuation">{</span><span class="token punctuation">...</span><span class="token attr-value">this</span><span class="token punctuation">.</span><span class="token attr-value">props</span><span class="token punctuation">}</span></span><span class="token punctuation">></span></span>\n        <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>Shell</span> <span class="token attr-name">dark</span> <span class="token attr-name">style</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span><span class="token punctuation">{</span> margin<span class="token punctuation">:</span> <span class="token string">\'8rem 0 5rem 0\'</span> <span class="token punctuation">}</span><span class="token punctuation">}</span></span><span class="token punctuation">></span></span>\n          <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>Shell.Cmd</span><span class="token punctuation">></span></span>$ yarn add foo<span class="token operator">-</span>bar<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>Shell.Cmd</span><span class="token punctuation">></span></span>\n          <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>Shell.Success</span><span class="token punctuation">></span></span>foo<span class="token operator">-</span>bar installed<span class="token operator">!</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>Shell.Success</span><span class="token punctuation">></span></span>\n        <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>Shell</span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>LandingPage</span><span class="token punctuation">></span></span>\n    <span class="token punctuation">)</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span></code></pre>\n      </div>\n<p>If you noticed - both the folder structure and the actual pages are super compact. This is where Dazzling tucks everything under its standard framework and opinions.</p>\n<p>Everything is standard React and standard Gatsby - feel free to edit, tweak and use the parts you like from Dazzling and ignore the parts you dislike.</p>\n<p>You can look at the various components Dazzling has <a href="">by going to its styleguide</a>.</p>\n<p>Next, check out how Dazzling supports a markdown based <a href="docs">documentation feature</a>.</p>',timeToRead:1,excerpt:"Dazzling is backed by  Gatsby , an amazing framework that lets you generates static content (websites, but really - anything) while keeping…",frontmatter:{title:"React"},fields:{slug:"/react"}}},pathContext:{slug:"/react"}}}});
